import React from 'react';
function Header(){
    return(
        <div className="wrapper">
            <div className="container">
                <div className="logo">
                    
                </div>
                <img src={process.env.PUBLIC_URL +"/logo.png"} alt="" />     
                    <span>AApet</span> 
                    
            </div>
        </div>
    )
};
export default Header;
